import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const RedirectToExit = ({ name, age }) => {
  const navigate = useNavigate();

  useEffect(() => {
    const timer = setTimeout(() => {
      navigate('/exit', { state: { name, age } });
    }, 5000);

    return () => {
      clearTimeout(timer);
    };
  }, [navigate, name, age]);

  return null;
};

export default RedirectToExit;
